import React from 'react';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer, Cell } from 'recharts';
import './TesterChart.css';

const TesterChart = ({ data }) => {
  const chartData = data.map(tester => ({
    name: tester.nombre,
    Pass: tester.passed,
    Pending: tester.pending,
    Failed: tester.failed
  }));

  const COLORS = {
    Pass: '#4ade80',
    Pending: '#fbbf24',
    Failed: '#ef4444'
  };

  const CustomTooltip = ({ active, payload, label }) => {
    if (active && payload && payload.length) {
      return (
        <div className="custom-tooltip">
          <p className="tooltip-label">{label}</p>
          {payload.map((entry, index) => (
            <p key={index} style={{ color: entry.fill }}>
              {`${entry.name}: ${entry.value}`}
            </p>
          ))}
        </div>
      );
    }
    return null;
  };

  return (
    <div className="tester-chart">
      <ResponsiveContainer width="100%" height={300}>
        <BarChart
          data={chartData}
          margin={{ top: 20, right: 30, left: 20, bottom: 5 }}
        >
          <CartesianGrid strokeDasharray="3 3" stroke="#e5e7eb" />
          <XAxis 
            dataKey="name" 
            tick={{ fill: '#6b7280', fontSize: 14, fontWeight: 600 }}
          />
          <YAxis 
            tick={{ fill: '#6b7280', fontSize: 14, fontWeight: 600 }}
          />
          <Tooltip content={<CustomTooltip />} />
          <Legend 
            wrapperStyle={{ 
              paddingTop: '20px',
              fontSize: '14px',
              fontWeight: 600
            }}
          />
          <Bar 
            dataKey="Pass" 
            fill={COLORS.Pass} 
            radius={[8, 8, 0, 0]}
            animationBegin={0}
            animationDuration={1000}
          />
          <Bar 
            dataKey="Pending" 
            fill={COLORS.Pending} 
            radius={[8, 8, 0, 0]}
            animationBegin={200}
            animationDuration={1000}
          />
          <Bar 
            dataKey="Failed" 
            fill={COLORS.Failed} 
            radius={[8, 8, 0, 0]}
            animationBegin={400}
            animationDuration={1000}
          />
        </BarChart>
      </ResponsiveContainer>
    </div>
  );
};

export default TesterChart;
